import React from 'react';



const DigitalClock = () => {
    setInterval(()=>{
        newTime = new Date().toLocaleTimeString();
    }, 1000)

    return newTime;
}


const Button = () => {

    return(
        <>
        <DigitalClock/>
        <h1> {newTime} </h1>
        </>
    );
}

export default Button;
